    true,nt"url": null,nt"notes": "<p>CDC child growth charts consist of a
    series of percentile curves that illustrate the distribution of selected body measurements
    in U.S. children. Pediatric growth charts have been used by pediatricians, nurses,
    and parents to track the growth of infants, children, and adolescents in the United
    States since 1977.   Growth charts are not intended to be used as a sole diagnostic
    instrument. Instead, growth charts are tools that contribute to forming an overall
    clinical impression for the child being measured.</p>n",nt"license_title":
